// 2. Add a new Component called Unit to display a unit

import { useState } from "react";

const UnitDelete = ({ unit }) => {
    event.preventDefault();
    console.log("unitObject", unitObject);
    axios.delete("http://localhost:3001/units", unit.id).then((response) => {
        console.log("Post response" + response.data);
        console.log("Unit deleted");
    });
};

const Unit = (props) => {
    return (
        <div className="unit">
            <h2>
                {props.code} {props.title}
            </h2>
            <button type="submit" onClick={UnitDelete}>
                Delete
            </button>
        </div>
    );
};

export default Unit;
